  return (
    <Fragment>
      <Navbar brand ='Agenda app'></Navbar>
      <div className='container'>
        <div className='row'>
          <div className='col-7'>
            <h2 style={{textAlign:'center'}}>Lista de Contactos</h2>
            <Userlist/>
